D0%BC%D0%B8%D1%80\" title=\"\u041a\u0440\u0430\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u041a\u0440\u0430\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u0430\u0442<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE-%D1%82%D0%B5%D0%B2%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1519%E2%80%941521)\" title=\"\u041f\u043e\u043b\u044c\u0441\u043a\u043e-\u0442\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1519\u20141521)\">\u041f\u043e\u043b\u044c\u0441\u043a\u043e-\u0442\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443 1519\u20141521 \u0433\u043e\u0434\u043e\u0432<\/a> \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u044f<\/a>, \u0431\u0443\u0434\u0443\u0447\u0438 \u043f\u0440\u0435\u0436\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B2%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u0422\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u043e\u0440\u0434\u0435\u043d\u0441\u043a\u0438\u043c \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u044b\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c<\/a>, \u043e\u0431\u0440\u0430\u0442\u0438\u043b\u0430\u0441\u044c \u0432 \u0433\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u043e (\u0441\u0442\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0421\u0432\u0435\u0442\u0441\u043a\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\">\u0441\u0432\u0435\u0442\u0441\u043a\u0438\u043c<\/a>&#160;\u2014 \u00ab\u0441\u0435\u043a\u0443\u043b\u044f\u0440\u043d\u044b\u043c\u00bb,&#160;\u2014 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c), \u043f\u043e\u0434\u0432\u043b\u0430\u0441\u0442\u043d\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0435\">\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u0443 \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u043c\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1546_%D0%B3%D0%BE%D0%B4\" title=\"1546 \u0433\u043e\u0434\">1546<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" title=\"\u0422\u0440\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u0422\u0440\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a> \u043f\u0440\u0438\u0437\u043d\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%83%D0%BB%D1%8C%D0%B3%D0%B0%D1%82%D0%B0\" title=\"\u0412\u0443\u043b\u044c\u0433\u0430\u0442\u0430\">\u0412\u0443\u043b\u044c\u0433\u0430\u0442\u0443<\/a> \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0439 \u0432\u0435\u0440\u0441\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D0%B1%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0438\u0431\u043b\u0438\u044f\">\u0411\u0438\u0431\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1605_%D0%B3%D0%BE%D0%B4\" title=\"1605 \u0433\u043e\u0434\">1605<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0434\u0441\u043a\u0438\u0439<\/a> \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_XI\" title=\"\u041a\u0430\u0440\u043b XI\">\u041a\u0430\u0440\u043b XI<\/a> \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0434\u0438\u043b\u0441\u044f \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u044c \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%83%D0%BB%D1%83\" title=\"\u041e\u0443\u043b\u0443\">\u041e\u0443\u043b\u0443<\/a> (\u043d\u044b\u043d\u0435&#160;\u2014 \u043e\u0434\u0438\u043d \u0438\u0437 \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u043a\u0440\u0443\u043f\u043d\u044b\u0445 \u0433\u043e\u0440\u043e\u0434\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a>).<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1766_%D0%B3%D0%BE%D0%B4\" title=\"1766 \u0433\u043e\u0434\">1766<\/a> \u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u043e\u0436\u0430\u0440\u043d\u0430\u044f \u043b\u0435\u0441\u0442\u043d\u0438\u0446\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1771_%D0%B3%D0%BE%D0%B4\" title=\"1771 \u0433\u043e\u0434\">1771<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II<\/a> \u043f\u043e\u0432\u0435\u043b\u0435\u043b\u0430 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u044f\u0442\u044c \u0441\u0440\u043e\u0447\u043d\u044b\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0434\u043b\u044f \u0441\u043f\u0430\u0441\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u044b<\/a> \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%B1%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D1%87%D1%83%D0%BC%D0%B0\" title=\"\u0411\u0443\u0431\u043e\u043d\u043d\u0430\u044f \u0447\u0443\u043c\u0430\">\u0431\u0443\u0431\u043e\u043d\u043d\u043e\u0439 \u0447\u0443\u043c\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1782_%D0%B3%D0%BE%D0%B4\" title=\"1782 \u0433\u043e\u0434\">1782<\/a>&#160;\u2014 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II \u0438\u0437\u0434\u0430\u0451\u0442 \u0443\u043a\u0430\u0437 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u00ab\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u0448\u043a\u043e\u043b\u00bb \u0432\u043e \u0432\u0441\u0435\u0445 \u0433\u043e\u0440\u043e\u0434\u0430\u0445 \u0420\u043e\u0441\u0441\u0438\u0438&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0445 (\u043f\u043e\u0441\u043b\u0435 \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u044b\u0445 \u0433\u043e\u0434\u043e\u043c \u0440\u0430\u043d\u0435\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a>) \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u044b\u0445 \u0431\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u044b\u0445 \u0448\u043a\u043e\u043b.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1820_%D0%B3%D0%BE%D0%B4\" title=\"1820 \u0433\u043e\u0434\">1820<\/a>&#160;\u2014 \u043d\u0430 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u043c \u043e\u0441\u0442\u0440\u043e\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D0%BE%D1%81\" title=\"\u041c\u0438\u043b\u043e\u0441\">\u041c\u0438\u043b\u043e\u0441<\/a> \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0438\u043d \u0419\u043e\u0440\u0433\u043e\u0441 \u041a\u0435\u043d\u0442\u0440\u043e\u0442\u0430\u0441 \u043d\u0430\u0448\u0451\u043b \u0441\u0442\u0430\u0442\u0443\u044e, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0443\u044e \u043a\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0_%D0%9C%D0%B8%D0%BB%D0%BE%D1%81%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430 \u041c\u0438\u043b\u043e\u0441\u0441\u043a\u0430\u044f\">\u0412\u0435\u043d\u0435\u0440\u0430 \u041c\u0438\u043b\u043e\u0441\u0441\u043a\u0430\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1827_%D0%B3%D0%BE%D0%B4\" title=\"1827 \u0433\u043e\u0434\">1827<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE-%D0%B1%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u043e-\u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u043e-\u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043c\u0435\u0436\u0434\u0443 \u0444\u043b\u043e\u0442\u0430\u043c\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_de_Monte_Santiago\" class=\"extiw\" title=\"es:Batalla de Monte Santiago\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041c\u043e\u043d\u0442\u0435 \u0421\u0430\u043d\u0442\u044c\u044f\u0433\u043e<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u0430<\/a> \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b\u0430 \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0443\u044e \u043a\u043e\u043b\u043e\u043d\u0438\u0437\u0430\u0446\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%85%D0%B0%D1%81\" title=\"\u0422\u0435\u0445\u0430\u0441\">\u0422\u0435\u0445\u0430\u0441\u0430<\/a> \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1838_%D0%B3%D0%BE%D0%B4\" title=\"1838 \u0433\u043e\u0434\">1838<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4\" title=\"\u041f\u0430\u0440\u043e\u0445\u043e\u0434\">\u041f\u0430\u0440\u043e\u0445\u043e\u0434<\/a> \u00abGreat Western\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%8E%D0%BD%D0%B5%D0%BB%D1%8C,_%D0%98%D0%B7%D0%B0%D0%BC%D0%B1%D0%B0%D1%80%D0%B4_%D0%9A%D0%B8%D0%BD%D0%B3%D0%B4%D0%BE%D0%BC\" title=\"\u0411\u0440\u044e\u043d\u0435\u043b\u044c, \u0418\u0437\u0430\u043c\u0431\u0430\u0440\u0434 \u041a\u0438\u043d\u0433\u0434\u043e\u043c\">\u0418\u0437\u0430\u043c\u0431\u0430\u0440\u0434\u0430 \u0411\u0440\u044e\u043d\u0435\u043b\u044f<\/a> \u043d\u0430\u0447\u0430\u043b \u0441\u0432\u043e\u0451 \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%81%D1%82%D0%BE%D0%BB%D1%8C\" title=\"\u0411\u0440\u0438\u0441\u0442\u043e\u043b\u044c\">\u0411\u0440\u0438\u0441\u0442\u043e\u043b\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>. \u041d\u0430 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b\u043e\u0441\u044c 15 \u0434\u043d\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1847_%D0%B3%D0%BE%D0%B4\" title=\"1847 \u0433\u043e\u0434\">1847<\/a>&#160;\u2014 \u0410\u0440\u0435\u0441\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> \u043f\u043e\u044d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%A2%D0%B0%D1%80%D0%B0%D1%81_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e, \u0422\u0430\u0440\u0430\u0441 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0422.&#160;\u0413.&#160;\u0428\u0435\u0432\u0447\u0435\u043d\u043a\u043e<\/a> \u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D1%82%D0%BE%D0%BC%D0%B0%D1%80%D0%BE%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u0441\u0442\u043e\u043c\u0430\u0440\u043e\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u041d.&#160;\u0418.&#160;\u041a\u043e\u0441\u0442\u043e\u043c\u0430\u0440\u043e\u0432\u0430<\/a> \u0437\u0430 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u044c \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%B8%D0%BB%D0%BB%D0%BE-%D0%9C%D0%B5%D1%84%D0%BE%D0%B4%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B1%D1%80%D0%B0%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041a\u0438\u0440\u0438\u043b\u043b\u043e-\u041c\u0435\u0444\u043e\u0434\u0438\u0435\u0432\u0441\u043a\u043e\u0435 \u0431\u0440\u0430\u0442\u0441\u0442\u0432\u043e\">\u041a\u0438\u0440\u0438\u043b\u043b\u043e-\u041c\u0435\u0444\u043e\u0434\u0438\u0435\u0432\u0441\u043a\u043e\u043c\u0443 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1853_%D0%B3%D0%BE%D0%B4\" title=\"1853 \u0433\u043e\u0434\">1853<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%85%D0%BC%D0%B0%D1%82%D1%8B\" title=\"\u0428\u0430\u0445\u043c\u0430\u0442\u044b\">\u0448\u0430\u0445\u043c\u0430\u0442\u043d\u044b\u0439<\/a> \u043a\u043b\u0443\u0431.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864_%D0%B3%D0%BE%D0%B4\" title=\"1864 \u0433\u043e\u0434\">1864<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A1%D0%A8%D0%90\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410<\/a>: \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F_%D0%A0%D0%B5%D0%B4-%D0%A0%D0%B8%D0%B2%D0%B5%D1%80\" title=\"\u041a\u0430\u043c\u043f\u0430\u043d\u0438\u044f \u0420\u0435\u0434-\u0420\u0438\u0432\u0435\u0440\">\u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438 \u0420\u0435\u0434-\u0420\u0438\u0432\u0435\u0440<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%9C%D0%B0%D0%BD%D1%81%D1%84%D0%B8%D0%BB%D0%B4%D0%B5\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041c\u0430\u043d\u0441\u0444\u0438\u043b\u0434\u0435\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041c\u0430\u043d\u0441\u0444\u0438\u043b\u0434\u0435<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0435\u0435\u0441\u044f \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u041a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u041a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B9%D0%BB%D0%BE%D1%80,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_(%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB)\" title=\"\u0422\u0435\u0439\u043b\u043e\u0440, \u0420\u0438\u0447\u0430\u0440\u0434 (\u0433\u0435\u043d\u0435\u0440\u0430\u043b)\">\u0420\u0438\u0447\u0430\u0440\u0434\u0430 \u0422\u0435\u0439\u043b\u043e\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u0432 \u043f\u0440\u0435\u0434\u0434\u0432\u0435\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%BE-%D0%BF%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D0%B8%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u0432\u0441\u0442\u0440\u043e-\u043f\u0440\u0443\u0441\u0441\u043a\u043e-\u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0410\u0432\u0441\u0442\u0440\u043e-\u043f\u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d \u043f\u0440\u0443\u0441\u0441\u043a\u043e-\u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e-\u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%8C%D1%87%D0%B6%D1%83%D1%80%D0%B8%D1%8F\" title=\"\u041c\u0430\u043d\u044c\u0447\u0436\u0443\u0440\u0438\u044f\">\u041c\u0430\u043d\u044c\u0447\u0436\u0443\u0440\u0438\u0438<\/a>, \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a> \u043e\u0431\u044f\u0437\u0430\u043b\u0430\u0441\u044c \u043f\u043e\u044d\u0442\u0430\u043f\u043d\u043e \u0432\u044b\u0432\u0435\u0441\u0442\u0438 \u0438\u0437 \u041c\u0430\u043d\u044c\u0447\u0436\u0443\u0440\u0438\u0438 \u0441\u0432\u043e\u0438 \u0432\u043e\u0439\u0441\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0442\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BE%D0%BA%D0%BA%D0%BE\" title=\"\u041c\u0430\u0440\u043e\u043a\u043a\u043e\">\u041c\u0430\u0440\u043e\u043a\u043a\u043e<\/a> \u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f\u0445, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u043e \u043d\u0435\u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u00ab\u0421\u0435\u0440\u0434\u0435\u0447\u043d\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u0435\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D0%BD%D1%82%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u043d\u0442\u0430\">\u0410\u043d\u0442\u0430\u043d\u0442\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%B3-%D0%9E%D0%BD%D0%BD%D0%B5%D1%81,_%D0%A5%D0%B5%D0%B9%D0%BA%D0%B5\" title=\"\u041a\u0430\u043c\u0435\u0440\u043b\u0438\u043d\u0433-\u041e\u043d\u043d\u0435\u0441, \u0425\u0435\u0439\u043a\u0435\">\u0425\u0435\u0439\u043a\u0435 \u041a\u0430\u043c\u0435\u0440\u043b\u0438\u043d\u0433-\u041e\u043d\u043d\u0435\u0441<\/a>, \u0438\u0437\u0443\u0447\u0430\u044f \u0441\u0432\u043e\u0439\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%82%D1%83%D1%82%D1%8C\" title=\"\u0420\u0442\u0443\u0442\u044c\">\u0440\u0442\u0443\u0442\u0438<\/a>, \u043e\u0445\u043b\u0430\u0436\u0434\u0451\u043d\u043d\u043e\u0439 \u0434\u043e \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D0%B4%D0%BA%D0%B8%D0%B9_%D0%B3%D0%B5%D0%BB%D0%B8%D0%B9\" title=\"\u0416\u0438\u0434\u043a\u0438\u0439 \u0433\u0435\u043b\u0438\u0439\">\u0436\u0438\u0434\u043a\u043e\u0433\u043e \u0433\u0435\u043b\u0438\u044f<\/a>, \u043e\u0442\u043a\u0440\u044b\u043b \u044f\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%B5%D1%80%D1%85%D0%BF%D1%80%D0%BE%D0%B2%D0%BE%D0%B4%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u0421\u0432\u0435\u0440\u0445\u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u044c\">\u0441\u0432\u0435\u0440\u0445\u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0424\u043b\u0430\u0433 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0442\u0440\u0438\u043a\u043e\u043b\u043e\u0440<\/a> \u0437\u0430\u043c\u0435\u043d\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0#1918\" title=\"\u0424\u043b\u0430\u0433 \u0420\u0421\u0424\u0421\u0420\">\u043a\u0440\u0430\u0441\u043d\u044b\u043c \u0444\u043b\u0430\u0433\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u043c\u0438<\/a> \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0431\u044b\u043b\u0430 \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B1%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041b\u0430\u0431\u0438\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041b\u0430\u0431\u0438\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d \u0436\u0443\u0440\u043d\u0430\u043b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D1%84%D0%BE%D1%82%D0%BE\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0435 \u0444\u043e\u0442\u043e\">\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0435 \u0444\u043e\u0442\u043e<\/a>\u00bb (\u0442\u0435\u043f\u0435\u0440\u044c&#160;\u2014 \u00ab\u0424\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%98%D1%81%D0%BF%D0%BE%D0%BB%D0%BD%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82\" class=\"mw-redirect\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0418\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u041a\u043e\u043c\u0438\u0442\u0435\u0442\">\u0412\u0426\u0418\u041a<\/a> \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043b\u0438\u0448\u0435\u043d\u0430 \u0441\u0442\u0430\u0442\u0443\u0441\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D1%80%D0%B8%D0%B4%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%BB%D0%B8%D1%86%D0%BE\" title=\"\u042e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043b\u0438\u0446\u043e\">\u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043b\u0438\u0446\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0443\u0433\u043e\u043b\u043e\u0432\u043d\u0430\u044f \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0430 \u043d\u0430 \u0434\u0435\u0442\u0435\u0439 \u0441\u0442\u0430\u0440\u0448\u0435 13 \u043b\u0435\u0442 (\u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0426\u0418\u041a \u0438 \u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\u0430 \u0421\u0421\u0421\u0420 \u00ab\u041e \u043c\u0435\u0440\u0430\u0445 \u0431\u043e\u0440\u044c\u0431\u044b \u0441 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u044c\u044e \u0441\u0440\u0435\u0434\u0438 \u043d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u043d\u0438\u0445\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_(1944)\" class=\"mw-redirect\" title=\"\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f (1944)\">\u041a\u0440\u044b\u043c\u0441\u043a\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438<\/a>, \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC\" title=\"\u041a\u0440\u044b\u043c\">\u041a\u0440\u044b\u043c<\/a> \u0431\u044b\u043b \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0451\u043d \u043e\u0442 \u043d\u0435\u043c\u0435\u0446\u043a\u043e-\u0440\u0443\u043c\u044b\u043d\u0441\u043a\u043e\u0439 \u043e\u043a\u043a\u0443\u043f\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u0435\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D0%9F%D0%92%D0%9E\" class=\"mw-redirect\" title=\"\u0412\u043e\u0439\u0441\u043a\u0430 \u041f\u0412\u041e\">\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u043c\u0438 \u041f\u0412\u041e<\/a> \u0441\u0431\u0438\u0442 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 . <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0430<\/a> \u0432\u044b\u0440\u0430\u0437\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u0440\u043e\u0442\u0435\u0441\u0442 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u044f \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0430. 18 \u0430\u043f\u0440\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u044f\u0432\u0438\u043b\u0438, \u0447\u0442\u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u041f\u0412\u041e \u0441\u0431\u0438\u043b\u0438 \u0447\u0430\u0441\u0442\u043d\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u044f\u0432\u0448\u0438\u0439\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u041e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u0430 \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D1%8E%D1%81-4\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441-4\">\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441-4<\/a>\u00bb \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BB%D1%81%D1%82%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0422\u043e\u043b\u0441\u0442\u0438\u043a\u043e\u0432, \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0415.&#160;\u0418.&#160;\u0422\u043e\u043b\u0441\u0442\u0438\u043a\u043e\u0432\u0430<\/a>, \u041f.&#160;\u0410.&#160;\u0413\u043e\u0440\u0434\u0438\u0435\u043d\u043a\u043e \u0438 \u0410.&#160;\u0413.&#160;\u0414\u0440\u0430\u043b\u043a\u0438\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0418\u0437\u0431\u0440\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D0%B6%D0%BD%D0%B5%D0%B2,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0411\u0440\u0435\u0436\u043d\u0435\u0432, \u041b\u0435\u043e\u043d\u0438\u0434 \u0418\u043b\u044c\u0438\u0447\">\u041b\u0435\u043e\u043d\u0438\u0434\u0430 \u0411\u0440\u0435\u0436\u043d\u0435\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%81%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8C_%D0%A6%D0%9A_%D0%9A%D0%9F%D0%A1%D0%A1\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430